import './App.css';
import {useState} from 'react'

function App() {
  const [displayData, setDisplayData] = useState([])

  return (
    <div className='app'>
      <div className='diplay'>
        {displayData.map((elem)=>{
          return(
            <>
              <h1>{elem.name}</h1>
              <p>{elem.age}</p>
              <p>{elem.username}</p>
            </>
          )
        })}
      </div>
    </div>
  );
}

export default App;
